import {
  BrowserRouter,
  Routes,
  Route,
  Navigate
} from "react-router-dom";
import "./App.css";
import Login from "./components/auth/Login";
import SignUp from "./components/auth/SignUp";
import Hotel from "./pages/hotel/Hotel";
import Home from "./pages/home/Home";
import AddHotel from "./components/addHotel/AddHotel";
import Room from "./pages/room/Room";
import AddRoom from "./components/addRoom/AddRoom";
import Transaction from "./pages/transaction/Transaction";
import EditRoom from "./components/editRoom/EditRoom";
import EditHotel from "./components/editHotel/EditHotel";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Navigate to="/auth/login"/>}/>
        <Route path="/auth/login" element={<Login/>}/>
        <Route path="/auth/signup" element={<SignUp/>}/>
        <Route path="/home" element={<Home/>}/>
        <Route path="/hotel" element={<Hotel/>}/>
        <Route path="/hotel/add-hotel" element={<AddHotel/>}/>
        <Route path="/hotel/edit-hotel" element={<EditHotel/>}/>
        <Route path="/room" element={<Room/>}/>
        <Route path="/room/add-room" element={<AddRoom/>}/>
        <Route path="/room/edit-room" element={<EditRoom/>}/>
        <Route path="/transaction" element={<Transaction/>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
